import "./Tittle.css"


function Tittle() {
  return(
  <div>
<h1><span class='one tittle'>L</span><span class='two '>a</span> <span class='three'>M</span><span class='four'>a</span><span class='five'>m</span><span class='six'>o</span><span class='one'>n</span><span class='two'>a</span></h1>
  </div>
  )
}
